To find the height, we need to find the radius first since the height is equal to the radius in a cylinder. We can find the radius by using the formula of the volume of the cylinder:
\[ V = \pi r^2 h \]
Given that the volume $V$ is $45\pi$ cubic cm, we can substitute the values into the formula and solve for the radius:
\[ 45\pi = \pi r^2 h \]
We can cancel out $\pi$ from both sides:
\[ 45 = r^2 h \]
Now we can solve for the radius:
\[ r^2 = \frac{45}{h} \]
\[ r = \sqrt{\frac{45}{h}} \]
Since the radius $r$ is equal to the height $h$ in a cylinder, we can substitute $r$ back into the equation and solve for the height:
\[ h = r = \sqrt{\frac{45}{h}} \]
Squaring both sides of the equation, we get:
\[ h^2 = \frac{45}{h} \]
Multiplying both sides by $h$, we get:
\[ h^3 = 45 \]
Taking the cube root of both sides, we get:
\[ h = \sqrt[3]{45} \]
So the height of the cylinder is $\boxed{\sqrt[3]{45}}$ cm.	
