Louis eats $\frac{1}{5}$ of the pie, and Jack eats $\frac{2}{3}$ of the pie.  We want to add the fractions to find the total amount eaten.  To add fractions, the denominators must be the same.  To get the same denominator, we need a common denominator.  The least common denominator of $5$ and $3$ is $15$.  So, we rewrite each fraction so that the denominator is $15$:

\begin{align*}
&\frac{1}{5}\times\frac{3}{3}+\frac{2}{3}\times\frac{5}{5}=\frac{3}{15}+\frac{10}{15}\\
&\frac{3+10}{15}=\frac{\boxed{13}}{15}
\end{align*}

Louis and Jack ate a total of $\boxed{\frac{13}{15}}$ of the pie.

